import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import MovieListApp from './components/home';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);

root.render(
  <React.StrictMode>
    <MovieListApp />
  </React.StrictMode>
);
